function rerender(url, name) {
  fetch(window.location.href).then((res)=>res.arrayBuffer()).then(r=>{

    var builder = dcodeIO.ProtoBuf.loadProtoFile(url);
    var data = document.body.innerHTML;
    document.innerHTML = "bill";
    builder.build();
    console.log(builder.result, data)
    for (var i in builder.result) {
      var out = builder.result[i][name].decode(r);
      document.body.innerHTML = "<pre>"+
        JSON.stringify(out, null, 2)
        .replace(/\{[^{}]*\}/gm, function (m) {
          return m.match(/\n/g).length>4 ? m : m.replace(/\n\s*/g, " ");
        })
        .replace(/ *"(\w*)": (null|\[\]),?\n/g, "")
        .replace(/},\n *{/g, "},{")
        .replace(/\[(\n *\w+,?)+\n *\]/g, function (m) {
          return m.match(/\n/g).length>8 ? m : m.replace(/\n\s*/g, " ")
        }).replace(/"(\w*)":/g, "<span style='color:gray'>$1</span>:")
        +"</pre>";
    }
  })
}

chrome.runtime.onConnect.addListener(function(port) {
  port.onMessage.addListener(function(msg) {

    var parts = msg.split(/[#;]/);
    console.log("Content script received: " + msg, parts);
    document.body.innerHTML = "The requested file is in protocol buffers format. Click "
      + "<a href='#'>here</a> to rerequest and display the content";
    document.querySelector("a").addEventListener("click", ()=>{
      rerender(parts[1], parts[2]);
    })
  });
});
